@Override
protected final BytesRef nextSeekTerm(BytesRef term) {
  while (hasNext()) {
    nextRange();
    if (term == null) {
      return currentCell;
    }

    final int comparison = term.compareTo(currentCell);
    if (comparison > 0) {
      seek(prefixCodedToGeoCoded(term), (short)(64 - getPrefixCodedShift(term)));
      continue;
    }
    return currentCell;
  }

  // no more sub-range enums available
  return null;
}

